desktopweb.customCSS:
/* Please make sure to not 
to assign this skin to anything
*/
div[id$="customheader"] > div:nth-child(3) {
  position: fixed !important;
}
/* for Allforms popup shadow*/
div.CopyslFbox{
  overflow: visible !important;
}
div#frmWireTransfer_AddRecipientAccount_flxTypeRadio1 >div:nth-child(2){
    top:5px !important;
}
div#frmWireTransfer_AddRecipientAccount_flxTypeRadio2 >div:nth-child(2){
    top:5px !important;
}

div[id$="lblCopyright"]{
  text-align: center !important;
}

div[id$="flxSegTransactionRowSavings_lblDescription"]{
  align-items : start !important;
}

div[id$="flxSegTransactionRowSelected_lblDescription"]{
  align-items : start !important;
}
div[id$="flxTravelNotificationsCollapsed_flxTravelNotificationsCollapsed"]>div{
  overflow: visible !important;
}
div[id$="flxTravelNotificationsExpanded_flxTravelNotificationsExpanded"]>div{
  overflow: visible !important;
}
div[id$="flxMyCardsCollapsed_flxMyCardsCollapsed"]>div{
  overflow: visible !important;
}
div[id$="flxMyCardsExpanded_flxMyCardsExpanded"]>div{
  overflow: visible !important;
}
div[id$="flxMyCardsCollapsedMobile_flxMyCardsCollapsedMobile"]>div{
  overflow: visible !important;
}
div[kwidgettype="Label"]
{
   outline:none !important;
}
div[kwidgettype="Label"]:focus
{
   outline:none !important;
}
input[kwidgettype="TextField"]:focus
{
	 outline:none !important;
} 
input[kwidgettype="Button"]:focus
{
	 outline:none !important;
} 
input[kwidgettype="Button"]:hover
{
	 cursor:pointer !important;
}
input[kwidgettype="Label"]:focus
{
	outline:none !important;
}
.sknFlxCustomScrollbar::-webkit-scrollbar {
 width:7px;
 background:transparent;

}
.sknFlxCustomScrollbar::-webkit-scrollbar-thumb {
 background:#d3d3d3

}
.-k-w-c-close-picker
{
  visibility: hidden !important;
}
.-kony-w-c-cell.-kony-w-c-yemo.-kony-w-c-yemo-skin
{
  outline:none !important;
}
.-k-w-c-datepicker-holder-main{
  height:300px !important;
}
input[kwidgettype="CalendarText"]:focus
{
	 outline:none !important;
	 width:75% !important;

} 
input[kwidgettype="CalendarText"]
{
	 width:75% !important;
     cursor:pointer !important;

}
input[kwidgettype="Calendar"]
{
	cursor:pointer !important;
}

div#frmBillPay_tableView_tableTabs_flxTabsChecking{
  overflow:scroll !important;
}

